			"label": "_58ce8551",
			"on_start_level": "if( not level.player.get_stored_event('introduced_prosperas_workshop'), scene_setup,
							remove_object(me)
						)
						
			where scene_setup = [
									set(frogatto.facing, 1),
									set(level.zoom, 1.5),
									screen_flash([0,0,0,255], [0,0,0,-1], 255),
									fire_event(conversation_controller,'triggered'),
